) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='课程介绍信息';

-- ----------------------------
--  Records of `course_introduce`
-- ----------------------------
BEGIN;
INSERT INTO `course_introduce` VALUES ('086fd95d61784d5a8e64c2087006d1b6', '2020-08-07 10:24:42', '2020-08-07 10:24:42', '<p>sdfsdfsdfdsf</p>'), ('1080731530578038786', '2019-01-03 15:44:08', '2019-01-03 15:44:08', '<p>本课程主要讲解使用微信小程序第三方制作平台零基础制作微信小程序，适合不懂编程的代码小白，简单易懂，轻松上手。&nbsp;&nbsp;<br></p>'), ('1080740234497036290', '2019-01-03 16:18:44', '2019-01-03 16:18:44', '<p>本课程将借助第三方小程序制作工具即速应用，带你快速制作小程序。&nbsp;&nbsp;<br></p>'), ('1080743050775040002', '2019-01-03 16:29:55', '2019-01-03 16:29:55', '<p>餐饮、电商、健身、教育等行业拥抱 小程序+&nbsp;&nbsp;<br></p>'), ('1080745129442742273', '2019-01-03 16:38:11', '2019-01-03 16:38:11', '<p><b>github:</b>https://github.com/binlian/binglian-blog</p><p><br></p><p><b>适合人群</b></p><p>如果你是在校大学生，想积累实战项目经验，或想完成一份让人刮目相看的毕业设计，那这门课非常适合你，本课程也特别适合在中小型互联网企业工作面试中提到项目经验</p><p>整合多个技术点，代码手把手教学，一步一步实现博客的各个功能，实现完整前后端的企业级Java项目。</p><p><b>开发环境&nbsp;</b><br></p><p>核心框架:Spring freemarker+Springboot<br></p><p>JDK：jdk1.8</p><p>数据库：MySQL</p><p>前端框架：Bootstrap + Jquery+ajax&nbsp;<br></p><p>IDE:STS、eclipse、Idea均可</p><p>开发环境：win、mac、linux均可</p><p>Maven：3</p>'), ('1080747476319408130', '2019-01-03 16:47:30', '2019-01-03 16:47:30', '<p><br></p>'), ('1080748086527725569', '2019-01-03 16:49:56', '2019-01-03 16:49:56', '<p>房价飞涨，年轻的我们刚毕业走出校门，又遇到令人喘不过气的房价！处于尴尬时期的我们，只能望楼兴叹，但是除此之外我们还可以房价分析！利用科学的技术手段，洞察房价的趋势！我们不买房，不炒房，但可以做到心中有个底！</p><p>这份课程中会使用到Python3来实现。包括用Python中的request库发起网络请求，使用Python库Beautifulsoup实现网页的解析，使用Python库Pandas实现数据的处理，例如数据的拆分，补全，格式化等操作。使用Python机器学习库scikit-learn对爬取的房价数据进行预测。通过本课程的学习，你可以掌握request库，python中的数据处理库Pandas及Python中的机器学习库scikit-learn，助你技术生涯不断进步和突破。</p><p>如果对Python、大数据感兴趣的同学可以观看由我录制的</p><p><br></p>'), ('1080748800733810689', '2019-01-03 16:52:46', '2019-01-03 16:52:46', '<p><br></p>'), ('1080749913470078978', '2019-01-03 16:57:11', '2019-01-03 16:57:11', '<p><br></p><p></p><p>Concodion是一个非常好的功能测试，BDD测试框架，可以将开发人员从烦躁的测试文档编写中解脱出来，所谓测试即文档，完成正确的测试就能帮你生成正确的文档</p><p>他的官方网站是：http://concordion.org/</p><p>课程将包含如下内容：</p><p>1. Concordion Introducing</p><p>2. Concordion environment setup</p><p>3. Concordion quick start</p><p>4. Concordion Command</p><p>5. Concordion Assert</p><p>6. Concordion Execute</p><p>7. Concordion tables</p><p>8. Concordion return Value</p><p>9. Concordion return MultiValueResult</p>'), ('1080750873948917762', '2019-01-03 17:01:00', '2019-01-03 17:01:00', '<p><br><br>注册成为会员 就这么简单看下面步骤就能完成最主流的zabbix的监控对接<br><br>1)在监控狗API用户中心获取token 设置接收电话以及告警策略<br><br>2)配置zabbix，新增使用电话告警发送告警信息配置。（需要去监控狗API官网下载一个脚本 具体实现过程视频就讲到<br><br>3)选择监控trigger，配置其action为使用电话告警发送信息。<br><br>4)触发trigger，电话 接收告警！<br><br>备注：其实整个过程跟 设置邮件报警大同小异&nbsp;&nbsp;<br></p>'), ('1080751684951150593', '2019-01-03 17:04:14', '2019-01-03 17:04:14', '<p><a href=\"http://www.roncoo.com/article/detail/127886\">Dubbo</a>&nbsp;（<a href=\"https://github.com/alibaba/dubbo\">https://github.com/alibaba/dubbo</a>）是阿里巴巴开源的分布式服务化治理框架（<a href=\"http://www.roncoo.com/course/view/cc8fbd6749f94f2fa015641ef96b9460\">微服务框架</a>），久经阿里巴巴电商平台的大规模复杂业务的高并发考验，到目前为止Dubbo仍然是开源界中体系最完善的服务化治理框架，因此Dubbo被国内大量的的互联网公司和专统企业使用，国内使用Dubbo的企业有：阿里巴巴、京东、当当、携程、去哪儿、搜狐、南方航空、中软国际、软通动力、各大电信运营商等</p><p><img alt=\"\" src=\"http://static.roncoo.com/lecturer/22bf8b231f524890a3e41ae9343f4030.jpg\">&nbsp;<img alt=\"\" src=\"http://static.roncoo.com/lecturer/9a99e300241248eb977a8b5dab816bf4.png\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/1c940a230a3e4582b2dc32ed09eccfb9.gif\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/8b04eaa57d4140b18fb92782aae30b2f.png\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/68eede73b2dc40cd9db7c082b8f5f1ad.png\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/86ae72864d8741a1a8dae86dd257f3dc.png\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/584e09b056174e8d849673cfe0bade63.png\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/77cda0a7e8c24f428d680e89721dc646.jpg\"><img alt=\"\" src=\"http://static.roncoo.com/lecturer/3073911c25bf499ba472be15c35c2953.jpg\"></p><p><br></p><p>京东、当当、去哪儿等企业还组建了自己的中间件团队按自己的业务需求对Dubbo进行框架定制，目前当当网已开源了自己的Dubbo定制版Dubbox ：<a href=\"http://www.oschina.net/p/dubbox\">http://www.oschina.net/p/dubbox</a></p><p>当当对Dubbo的评价：<strong>Dubbo是一个被国内很多互联网公司广泛使用的开源分布式服务框架，即使从国际视野来看应该也是一个非常全面的SOA基础框架。</strong>作为一个重要的技术研究课题，在当当网我们根据自身的需求，为Dubbo实现了一些新的功能，并将其命名为Dubbox（即Dubbo eXtensions）。</p><p><br></p><p><img alt=\"\" src=\"http://static.roncoo.com/lecturer/f08be4b96e064808b83e5e5129685efa.jpg\"></p><p><img alt=\"\" src=\"http://static.roncoo.com/lecturer/28b46ca3950a493181a0b2799baca214.jpg\"></p>'), ('1080752794281644033', '2019-01-03 17:08:38', '2019-01-03 17:08:38', '<p><a href=\"http://www.roncoo.com/article/detail/124661\">Spring</a>&nbsp;也表示是一个开源框架，是为了解决企业应用程序开发复杂性由Rod Johnson创建的。框架的主要优势之一就是其分层架构，分层架构允许您选择使用哪一个组件，同时为 J2EE 应用程序开发提供集成的框架。Spring的用途不仅限于服务器端的开发。从简单性、可测试性和松耦合的角度而言，任何<a href=\"http://www.roncoo.com/article/detail/128365\">Java</a>应用都可以从Spring中受益。&nbsp;&nbsp;<br></p>'), ('1080753909626769409', '2019-01-03 17:13:04', '2019-01-03 17:13:04', '<p><a href=\"http://www.roncoo.com/course/view/c99516ea604d4053908c1768d6deee3d\">Spring Boot</a>是由Pivotal团队提供的全新框架，其设计目的是用来简化新<a href=\"http://www.roncoo.com/course/view/ec26aa06aa8d4ff6b75ef5ee7b67d06d\">Spring</a>应用的初始搭建以及开发过程。该框架使用了特定的方式来进行配置，从而使开发人员不再需要定义样板化的配置。通过这种方式，Boot致力于在蓬勃发展的快速应用开发领域（rapid application development）成为领导者。</p><p><br></p><p>本课程属于Spring Boot教程全集里面的一部分，最佳入门教程！</p><p><br></p><p>教程由浅入深，一步一步学习Spring Boot，最后学到的不单单是基础！</p><p><br></p><p><br></p><p>注：本课程属于Spring Boot教程全集里面的一部分！</p><p><br></p><p><br></p>'), ('1080755660404756482', '2019-01-03 17:20:01', '2019-01-03 17:20:01', '<p>2017年微信小程序课程全新上线，全网首家小程序运营推广教学！</p><p><br></p><p>小程序到底是什么？在风口下为什么大家都选择小程序？小程序的发展前景怎么样？小程序比起APP和公众号优势在哪里？没接触过代码怎么做出一个精美的小程序？社区、电商平台怎么搭建？ 13年前的淘宝，7年前的微博，4年前的微信公众号。风口来临时你是否抓住机会？2017年小程序来势汹汹，站在未来3年各行业的千亿级风口处，各方暗潮涌动，你制作小程序了吗？</p><p><br></p><p>这套课程，就是为不懂编程代码、但又希望能亲自开发微信小程序的学员们量身打造的。<strong>设计、制作、上传、运营、推广……</strong>所有小程序知识要点分7大章节全面梳理，专业讲师细致讲解，丰富案例深入剖析，让学员无需编程基础也可以轻松上手小程序！</p><p><br></p><p><strong>温馨提示：本视频内容使用组件拖拽式，零代码生成微信小程序，</strong><strong>并非编程开发教学视频。</strong></p><p><strong><br></strong></p><p><strong>如有疑问请联系学院客服。</strong></p>'), ('1080756535550480385', '2019-01-03 17:23:30', '2019-01-03 17:23:30', '<p><br></p>'), ('1080757024128176129', '2019-01-03 17:25:27', '2019-01-03 17:25:27', '<p>1 、讲解web常用的漏洞有那些，攻击者怎么样获取到漏洞，应该怎样进行防御&nbsp;<br><br>2 、解析防护脚本&nbsp;<br><br>3 、实战进行 扫描防护 &nbsp;sql注入防护&nbsp;&nbsp;&nbsp;<br></p>'), ('1080757537691340802', '2019-01-03 17:27:29', '2019-01-03 17:27:29', '<p>全网独家第一套深入浅出讲解Hystrix高可用技术框架的项目实战视频课程！</p><p><br></p><p><br></p><p>高可用相关的技术以及架构，对于大型复杂的分布式系统，是非常重要的。而<a href=\"http://www.roncoo.com/course/view/85d6008fe77c4199b0cdd2885eaeee53\">高可用架构</a>中，非常重要的一个环节，就是如何将分布式系统中的各个服务打造成高可用的服务，从而足以应对分布式系统环境中的各种各样的问题，比如服务间的调用超时，或者服务间的调用失败，避免整个分布式系统被某个服务的故障给拖垮。而要解决这些棘手的分布式系统可用性问题，就涉及到了高可用分布式系统中的很多重要的技术，包括资源隔离，限流与过载保护，熔断，优雅降级，容错，超时控制，监控运维，等等。而行业中大部分的朋友，对高可用系统架构以及相关的技术并没有太多的了解，这也成为了你设计一个复杂的高可用系统架构，或者面试高阶Java职位时的一个重要阻碍。</p><p><br></p><p><br></p><p>在行业中，实现高可用架构的非常流行和重要的框架就是Hystrix，是国外知名的视频网站Netflix所开源的。Hystrix能够完美的解决分布式系统架构中，打造高可用服务面临的一系列技术难题，包括资源隔离，限流与过载保护，熔断，优雅降级，容错，超时控制，监控运维等等。</p><p><br></p><p><br></p><p>本课程是一套基于Hystrix技术的高可用架构的项目实战课程，用每日上亿流量的大型电商网站中的商品详情页系统中的缓存服务，作为项目实战。基于Hystrix高可用技术框架，讲解了在缓存服务所处的复杂分布式环境中，如何将缓存服务本身设计成一个高可用的服务。进而让大家学习到，在分布式系统中如何将每个服务设计成一个高可用的服务，以及其中涉及的一系列通用的技术架构以及解决方案。在学习完本套课程之后，相信各位同学能够对Hystrix高可用技术掌握到一定的程度，进而掌握高可用的分布式系统架构设计的核心技术。进而形成自己的职场技术竞争力，为自己增加技术亮点，为自己找到职场发展中一个更好的职位和机会提供帮助。同时也能帮助自己在工作中，开发实际的分布式系统架构或项目时，将每个服务都打造成真正高可用的服务，让你负责的项目更加的稳定，进而保障公司的利益。</p><p><br></p><p>精品课程推荐</p><p><br></p><p><br></p><p><a href=\"http://www.roncoo.com/course/view/af7d501667fe4a19a60e9467e6d2b3d9\">《亿级流量电商详情页系统的大型高并发与高可用缓存架构实战》</a></p><p>本课程属于全网独家的大型Java高端架构项目实战课程，整套课程分为123讲，纯项目实战驱动，讲解最顶尖的缓存架构。</p><p><br></p><p><br></p>'), ('1080758482454122498', '2019-01-03 17:31:14', '2019-01-03 17:31:14', '<p><br></p>'), ('1080759102695215105', '2019-01-03 17:33:42', '2019-01-03 17:33:42', '<p><br></p>'), ('1080759557651369985', '2019-01-03 17:35:31', '2019-01-03 17:35:31', '<p><br></p>'), ('1085453180192059393', '2019-01-16