  `is_success` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否发送成功(1发送成功，0:发送失败)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户发送短信日志';

